function greenajax(e,r){fetch(e.url,{method:e.method.toUpperCase(),body:JSON.stringify(e.body),mode:e.mode||"cors",credentials:e.credentials||"same-origin",catch:e.catch||"default",redirect:e.redirect||"follow",referrer:e.referrer||"about:client",referrerPolicy:e.referrerPolicy||"no-referrer",headers:e.headers||{"Content-Type":"application/json"}}).then(e=>e.json()).then(r).catch(e=>{throw e})}